import {getHeroesById} from './bases/export'
const promise = new Promise((resolve,reject)=>{

    setTimeout(()=>{
        const hero=getHeroesById(2)
        resolve(hero)
    },200)
});

promise.then((heroe)=>{
    console.log(heroe)
})
